import React, { useEffect, useState } from "react";
import { Container, Form, Navbar, Nav, NavDropdown } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const Homepage = () => {
  let navigate = useNavigate();
  const [data, getData] = useState([]);
  const gettingdata = () => {
    axios.get("https://fakestoreapi.com/products").then((response) => {
      getData(response.data);
      console.log(response.data);
    });
  };
  useEffect(() => {
    gettingdata();
  }, []);
  return (
    <Form>
      <div class="container-fluid">
        <Navbar collapseOnSelect fixed="top" expand="sm">
          <Container style={{ alignContent: "start" }}>
            <Nav classname="me-auto">
              <Nav.Link
                onClick={() => {
                  navigate("/Home");
                }}
              >
                Home
              </Nav.Link>
              <Nav.Link
                onClick={() => {
                  navigate("/Books");
                }}
              >
                Books
              </Nav.Link>
              <NavDropdown
                title="Electronics"
                id="basic-nav-dropdown"
                bg="primary"
              >
                <NavDropdown.Item
                  onClick={() => {
                    navigate("/Electronics/Mobilephone");
                  }}
                >
                  MobilePhone
                </NavDropdown.Item>
                <NavDropdown.Item
                  onClick={() => {
                    navigate("/Electronics/Desktop");
                  }}
                >
                  Desktop Pc
                </NavDropdown.Item>
                <NavDropdown.Item
                  onClick={() => {
                    navigate("/Electronics/Laptop");
                  }}
                >
                  Laptop
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Container>
        </Navbar>
      </div>
      <div className="container">
        <div className="row">
          {data.map((value) => {
            return (
              <div className="col md-4">
                <div className="card-body">
                  <img
                    className="card-img-top"
                    src={value.image}
                    alt="Card image cap"
                  />
                  <h6 className="card-title">{`Id:${value.id}`}</h6>
                  <h6 className="card-title">{`Email:${value.title}`}</h6>
                  <h6 className="card-title">{`Id:${value.price}`}</h6>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </Form>
  );
};

export default Homepage;
